import { Component } from '@angular/core';
import {  Router } from '@angular/router';

@Component({
  selector: 'app-navigatebar',
  templateUrl: './navigatebar.component.html',
  styleUrls: ['./navigatebar.component.css']
})
export class NavigatebarComponent {
  isShowing: boolean | undefined;

  constructor(private router: Router){}

  toggleSidenav() {
    this.isShowing = !this.isShowing;
  }

  callMethods() {
      this.toggleSidenav();
  }
  logout(){
    window.localStorage.removeItem("loggedinuser") 
    this.router.navigateByUrl('/')
  }
}
<nav class="nav1">
    <div>
        <a routerLink="/homepage" class="h1b">Yudaa Food & Cosmetics</a>
    </div>
    <div>
        <a class="btn1">About Us</a>
        <a class="btn1"> Contact Us</a>
        <a class="btn2">Schedule Pickup</a>
        <a class="btn1">Profile</a>
        <a class="btn1" (click)="logout()">Logout</a>
    </div>

</nav>
